import { useEffect } from 'react';
import * as s from '../styles/categoryFilterStyle';
import { useSelector } from 'react-redux';

const CategoryFilter = ({ payload, close }: any) => {
  const { event, data } = payload;
  useEffect(() => {
    console.log(data);
  }, []);
  return (
    <s.CategoryFilterContainer>
      <s.CategoryFilterHeader>
        <s.CategoryFilterHeaderTitle>펫쿠아 추천순</s.CategoryFilterHeaderTitle>
      </s.CategoryFilterHeader>
      <s.CategoryFilterBody>
        {data?.Filter?.map((item: any) => (
          <s.CategoryFilterItem key={item.id}>{item.name}</s.CategoryFilterItem>
        ))}
      </s.CategoryFilterBody>
      <s.CategoryFilterButtonContainer>
        <s.CategoryFilterButton onClick={close}>적용하기</s.CategoryFilterButton>
      </s.CategoryFilterButtonContainer>
    </s.CategoryFilterContainer>
  );
};

export default CategoryFilter;
